import React from "react";
import "./CardItem.css";
import { Books } from "../../../components/logo/BookLogo";
const CardItem = (props) => {
  return (
    <div className="card card-md" onClick={props.clicked}>
      <Books />
      <span className="label">{props.item.label}</span>
      <span className="value">{props.item.value}</span>
    </div>
  );
};

export default CardItem;
